import './App.css';
import React from 'react';
import SearchPage from '../SearchPage/SearchPage.tsx';
import MyPage from '../MyPage/MyPage.tsx';
import { useState } from 'react';

type pageType = 'search' | 'favorites';

function App() {
  const [page, setPage] = useState('search');

  const showSearch = (page) => {
    return <SearchPage />;
  };

  const showMyPage = (page) => {
    return <MyPage />;
  };

  return (
    <div className="App">
      <nav className="navbar navbar-expand-lg navbar-light bg-white">
        <a className="navbar-brand" href="https://www.metmuseum.org/" />
        <img
          src="http://www.logologika.ru/i/upload/1736.jpg"
          className="img-fluid rounded-start w-8"
          alt="logo"
        />
        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav ml-auto">
            <li className="nav-item mr-4" onClick={() => showSearch(page)}>
              <button className="nav-link mr-4">
                Search the Metropolitan Museum of Art
              </button>
            </li>
            <li className="nav-item">
              <button
                type="button"
                className="nav-link"
                onClick={() => showMyPage(page)}
              >
                My Favorite Art Pieces
              </button>
            </li>
          </ul>
        </div>
      </nav>
      {page ? <SearchPage /> : <MyPage />}
      {/* <img width={400} src={logo} alt="react" /> */}
      {/* <SearchPage /> */}
      {/* <TweetsList /> */}
    </div>
  );
}

// if (page ===)

export default App;
